import { useLocation } from 'react-router-dom'
import { Message } from "../../components/layout/messages/Message"

export const Projects = () => {
    // capta a messagem de onde est치 vindo o redirect e seta na vari치vel como let message
    const location = useLocation()
    let message = ''
    // se vir a message, obtem!
    console.log(location)

    message = location.state ? location.state : null

    return (
        <section>
            <h1>Meus Projetos</h1>
            {message && 
                <Message type='sucess' msg={message}/>
            }
        </section>
    )
}
